import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header
    style={{
      background: '#0a0a36',
      color: '#fff',
      padding: '10px 30px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
    }}
  >
    <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
      <img
        src="/assets/GFX_logo.jpg"
        alt="Millennial Logo"
        style={{
          height: '36px',
          width: '36px',
          objectFit: 'contain',
          borderRadius: '4px',
        }}
      />
      <span style={{ fontSize: '1.5rem', fontWeight: 'bold' }}>Millennial GFX</span>
    </div>

    <nav style={{ display: 'flex', gap: '20px', fontWeight: 'bold' }}>
      <Link to="/" style={navStyle}>Home</Link>
      <Link to="/about" style={navStyle}>About</Link>
      <Link to="/services" style={navStyle}>Services</Link>
      <Link to="/portfolio" style={navStyle}>Portfolio</Link>
      <Link to="/contact" style={navStyle}>Contact</Link>
    </nav>
  </header>
);

const navStyle = {
  color: 'white',
  textDecoration: 'none',
  transition: 'color 0.3s ease',
};

export default Header;
